'use strict';

var casper = require('casper').create(),
  lipsum = require('../proxies/lipsum'),
  chance = require('../proxies/chance'),
  moment = require('../proxies/moment')


casper.start('http://localhost:8000/#project/new')


casper.repeat(50, function (){
  this.thenEvaluate(function (title, description, date){
    document.querySelector('input#title').setAttribute('value', title)
    document.querySelector('article#description').innerHTML = description
    document.querySelector('input#date').setAttribute('value', date)

  }, chance.sentence(),
    lipsum({count: 10, units: 'paragraphs', format: 'html' }),
    moment(chance.date()).format('YYYY-MM-DD')
  )

  this.then(function (){
    this.click('#plus-link')
  })

  this.then(function (){
    this.thenEvaluate(function (name,url){
      document.querySelector('#link-0 > div.col-md-offset-1.col-md-7.form-group > input:nth-child(2)').setAttribute('value', name)
      document.querySelector('#link-0 > div.col-md-offset-1.col-md-7.form-group > input:nth-child(4)').setAttribute('value', url)
    }, chance.sentence({words: 4}),
      chance.domain())
  })

  this.then(function (){
    this.click('#plus-video')
    this.click('#plus-video')
  })

  this.then(function (){
    this.thenEvaluate(function (youtube, vimeo){
      document.querySelector('#video-0 > div.col-md-10 > input').setAttribute('value', youtube)
      document.querySelector('#video-1 > div.col-md-10 > input').setAttribute('value', vimeo)
    }, '<iframe width="420" height="315" src="//www.youtube.com/embed/wZZ7oFKsKzY" frameborder="0" allowfullscreen></iframe>',
      '<iframe src="//player.vimeo.com/video/95974049" width="500" height="281" frameborder="0" webkitallowfullscreen mozallowfullscreen allowfullscreen></iframe>')
  })

  this.then(function (){
    this.click('#plus-image')
    this.click('#plus-image')
  })

  this.then(function (){
    this.thenEvaluate(function (img1, img2, name1, name2){
      document.querySelector('#image-0 > div.col-md-7 > input:nth-child(1)').setAttribute('value', name1)
      document.querySelector('#image-0 > div.col-md-3 > img').setAttribute('data-src', img1)
       document.querySelector('#image-1 > div.col-md-7 > input:nth-child(1)').setAttribute('value', name2)
      document.querySelector('#image-1 > div.col-md-3 > img').setAttribute('data-src', img2)
    }, 'data:image/jpeg;base64,',
      'data:image/jpeg;base64,',
      chance.sentence(),
      chance.sentence()
      )
  })

  this.then(function (){
    this.click('#save')
  })

  this.then(function (){
    this.open('http://localhost:8000#project/new')
  })

})

casper.run();
